function operator(proxies, targetPlatform) {
  const defaultPath = '/proxyIP=proxyip.jp.fxxk.dedyn.io'
  const content = `Pages [trojan] = trojan, ____________.com, 443, password=0fd9b883-0551-4ed1-b978-528183b459a2, skip-cert-verify=true, sni=____________.com, ws=true, ws-path=/, ws-headers=Host:"____________.com", tfo=true`

  function removeDuplicates(arr, fields) {
    const map = new Map()
    return arr.filter(item => {
        const key = fields.map(field => item[field]).join('-')
        if (map.has(key)) {
            return false
        } else {
            map.set(key, true)
            return true
        }
    })
  }
  let paths = Array.from(new Set(proxies.map(p => p['ws-opts']?.path).filter(p => /proxyip/i.test(p))))
  paths = paths.length ? paths : [defaultPath]
  let list = ProxyUtils.parse(content)
  let result = []
  removeDuplicates(proxies, ['server', 'port']).map(p => {
    paths.map(path => {
      list.map(i => {
        result.push({
          ...i,
          name: `${ProxyUtils.getFlag(p.name)} ${ProxyUtils.getISO(p.name)} ${i.name}`,
          server: p.server,
          port: p.port,
          'skip-cert-verify': true,
          'ws-opts': {
            ...i['ws-opts'],
            path,
          }
        })
      })
    })
  })
  return result
}
